import React from 'react';
import styles from '../TeacherLogin/TeacherLogin.module.css';
import {useFormik} from 'formik'

function TeacherLogin() {

  const formik = useFormik({

    initialValues:{
      "name":"",
      "password":""
    }

  })

  console.log(formik.values)

  return (
    <div>
        <form className={styles.form}>
            <label type="email" htmlFor="email">email</label>
            <input type="email" id="email" name = "email" onChange={formik.handleChange} value={formik.values.name}>{formik.values.name}</input>

            <label type="text" htmlFor="password">password</label>
            <input type="password" id="password" name = "password" onChange={formik.handleChange} value={formik.values.password}>{formik.values.password}</input>

            <button type="submit">submit</button>
        </form>
    </div>
  )
}

export default TeacherLogin
